import React from "react";
import DroneListItem from "./DroneListItem";
import FilterByDistance from "./FilterByDistance";
import DroneService from "../services/DroneService";

const ListComponent = ({droneData}) => {
    return(
        <ul>
            {Object.keys(droneData).map(drone => 
            <DroneListItem key={droneData[drone].serialNumber} droneData={droneData} drone={drone} pilotData={DroneService.pilotData(droneData[drone].serialNumber)}/>
        )}
        </ul>
    )
};

export default ListComponent;
